import React from "react";
import image1 from "../User-images/about1.webp";
import image2 from "../User-images/about3.webp";
import image3 from "../User-images/about2.webp";
import "./Aboutus.css";
function About() {
  return (
    <div>
      <h1
        style={{
          textAlign: "center",
          fontFamily: "sans-serif",
          fontSize: "50px",
          marginTop: "25px",
        }}
      >
        <b>About</b>
      </h1>
      <h5 style={{ textAlign: "center" }}>
        Who we are, what we do, and how we test products
      </h5>
      <hr
        style={{
          marginLeft: "5%",
          marginRight: "5%",
        }}
      />
      <div className="main-card1">
        <div className="sub-card1" style={{ width: "30rem" }}>
          <img src={image1} alt="About image" />
          <h3>
            <b>What We're All About: The LapTopia Editorial Mission</b>
          </h3>
        </div>
      </div>
      <div className="main-card1">
        <div className="sub-card1" style={{ width: "30rem" }}>
          <img src={image2} alt="About image" />
          <h3>
            <b>Who We Are : Meet The Editorial Team Of Us</b>
          </h3>
        </div>
      </div>
      <div className="main-card1">
        <div className="sub-card1" style={{ width: "30rem" }}>
          <img src={image3} alt="About image" />
          <h3>
            <b>What Are The Mission and Vission OF LapTopia </b>
          </h3>
        </div>
      </div>
    </div>
  );
}

export default About;
